import React from 'react';
import classes from './TodoList.module.css';

const TodoList = (props) => {
  /* 
  

*/

  return (
    <ul key={props.id}>
      <li>{props.title}</li>
      <li
        className={props.completed ? 'styles.completed' : 'styles.uncompleted'}
      >{`completed ${props.completed}`}</li>
    </ul>
  );
};

export default TodoList;
